import React from "react";
import Particles from "react-particles";

const Part = () => {
    return (
        <div>
        <Particles params={{
            particles: {
              number: {
                value: 30,
                density: {
                  enable: true,
                  value_area: 800
                }
              }
            }
          }}></Particles>
        </div>  
    )
}

export default Part;
